
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='800' height='400'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1
	
// #rect64
	ctx.beginPath();
	ctx.fillStyle = 'rgb(204, 204, 204)';
	ctx.strokeStyle = 'rgb(5, 4, 0)';
	ctx.lineWidth = 1.882200;
	ctx.moveTo(-1.362282, 24.521061);
	ctx.lineTo(-1.362282, 374.627319);
	ctx.quadraticCurveTo(-1.362282, 399.148380, -1.362282, 399.148380);
	ctx.lineTo(801.021328, 399.148380);
	ctx.quadraticCurveTo(801.021328, 399.148380, 801.021328, 374.627319);
	ctx.lineTo(801.021328, 24.521061);
	ctx.quadraticCurveTo(801.021328, -0.000000, 801.021328, -0.000000);
	ctx.lineTo(-1.362282, -0.000000);
	ctx.quadraticCurveTo(-1.362282, -0.000000, -1.362282, 24.521061);
	ctx.fill();
	ctx.stroke();
	
// #path154
	ctx.beginPath();
	ctx.fillStyle = 'rgb(0, 255, 0)';
	ctx.strokeStyle = 'rgb(5, 4, 0)';
	ctx.lineWidth = 1.882200;
	ctx.arc(202.979890, 198.893050, 166.198300, 0.000000, 6.28318531, 1);
	ctx.fill();
	ctx.stroke();
	
// #text5766
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, -40.868400, 10.898200);
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.font = "normal normal 40px sans-serif";
	ctx.restore();
	
// #text22340
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.font = "normal normal 40px sans-serif";
	
// #text29454
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, 46.317600, 2.724560);
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.font = "normal normal 40px sans-serif";
	ctx.restore();
	
// #text36546
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.font = "normal normal 40px sans-serif";

    </script>
</body>
</html>
